import React from 'react';
import ReactDOM from 'react-dom';
import {createStore, compose, applyMiddleware, combineReducers} from 'redux'
import './index.css';
import App from './App';
import {composeWithDevTools} from 'redux-devtools-extension'
import {Provider} from 'react-redux'
import thunk from 'redux-thunk'
import destinationsReducer from './Reducers/DestinationReducer'
import timelineReducer from './Reducers/TimeLineReducer';

const initialState = {
  destinations: [],
  addedDestinations: [],
  timelineData: []
}

const rootReducer = combineReducers({
  destinations: destinationsReducer,
  addedDestinations: addedDdestinationReducer,
  timelineData: timelineReducer
})

const store = createStore(rootReducer, initialState, compose(applyMiddleware(thunk), composeWithDevTools()))



ReactDOM.render(
    <Provider store = {store}>
    <App />
    </Provider>,
  document.getElementById('root')
);
